window.bookSummaryJSON = "<p><b>Daddy's little girl is all grown up.</b></p> <p>Things are about to change around here. </p> <p>If there is one thing I won't allow, it's having my dad's MC run into the ground. </p> <p>Everyone expects my brothers to take charge, but there is one thing no one knows. </p> <p>I'm the one that runs this club. </p> <p>A woman. </p> <p>And according to men, a woman's place is in bed, not at the head of the table. </p> <p>News flash: I'm not only going to be the head of the table, but I'm putting the word out. </p> <p>Women can join. </p> <p>Men can join. </p> <p>Everyone can join and be accepted. </p> <p>My brothers? We are all triplets and they support me and have my back. </p> <p>They know I'm meant for more than what society has mapped out for women. </p> <p>Well, I'm taking the bull by its horns. </p> <p>And this MC is mine. </p> <p>There's a problem. </p> <p>Not many people like my choice. Not many men want to follow a woman. </p> <p>That's fine with me. </p> <p>The Vice President thinks he is going to be President when my dad dies. </p> <p>An extremely sick, cruel awakening awaits. </p> <p><b>It's ME.</b></p> <p><b>And I'm a take-no-prisoners kind of woman.</b></p>"; 
